    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments during the 1971 calendar year. The
    report begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and disease-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, and vegetation control. Resource
    management is discussed; topics include haying and fur harvesting. A progress report
    on field investigations and applied research is included. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, photographs, and
    narrative reports for Upper Klamath National Wildlife Refuge, Lower Klamath National
    Wildlife Refuge, Clear Lake, and Klamath Forest National Wildlife Refuge are attached.",nt"license_title":
